import React from "react";
import ReactDOM from "react-dom";
import App from "./App";
import store from "./store";
import { loadUser } from "./actions/auth";

store.dispatch(loadUser());

ReactDOM.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>,
  document.getElementById("root")
);
